function App() {
  const [cards, setCards] = useState([]);

  const handleAddCard = (cardData) => {
    setCards([...cards, cardData]);
  };

  const handleDeleteCard = (index) => {
    setCards(cards.filter((_, i) => i !== index));
  };

  const [visible, setVisible] = useState(true);

  const closeCallout = () => {
    setVisible(false);
